import React from "react";
import styled from "styled-components";
import GridIMG from "../../Images/grid.svg";
import Footer from "../Footer";

const GridBackground = styled.div`
  background-color: rgba(79, 79, 79, 0.95);
  min-height: 90vh;
  height: 100%;
  border: 3px solid #662d91;
`;

const Container = styled.div`
  width: 99vw;
  min-height: 75vh;
  margin-top: 10px;
  background-image: url(${GridIMG});

  @media (max-width: 600px) {
    width: 100vw;
  }
`;

const LoginContainer = styled.div`
  width: 80vw;
  max-width: 600px;
  min-height: 375px;
  height: 50vh;
  max-height: 450px;
  margin: 0 auto;
  text-align: center;
  background-color: rgba(255, 255, 255, 0.7);
  border: 4px solid #fff;
  border-radius: 5px;
  position: fixed;
  top: 50vh;
  left: 50vw;
  transform: translate(-50%, -50%);
  -webkit-transform: translate(-50%, -50%);
  -moz-transform: translate(-50%, -50%);
  -o-transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
`;

const ContentCenter = styled.div`
  width: 100%;
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  -webkit-transform: translate(-50%, -50%);
  -moz-transform: translate(-50%, -50%);
  -o-transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
`;

const Title = styled.h1`
  font-size: 1.2em;
  letter-spacing: -0.25px;
  margin-top: -10px;
  color: #153056;
  font-family: "Oswald", sans-serif;
`;

const ButtonContainer = styled.div`
  margin: 25px auto 0;
  width: 80%;
  max-width: 360px;
  display: flex;
  justify-content: space-between;
`;
const Login = () => {
  return (
    <div>
      <Container>
        <GridBackground />
        <LoginContainer>
          <ContentCenter>
            <Title>PATIENT PORTAL</Title>
            <LoginInput
              type="email"
              placeholder="Patient ID or Email Address"
            />
            <LoginInput type="password" placeholder="Password" />
            <ButtonContainer>
              <LoginLink href="/">FORGOT LOGIN?</LoginLink>
              <LoginLink href="/">NEW PATIENT?</LoginLink>
              <Button>Log In</Button>
            </ButtonContainer>
          </ContentCenter>
        </LoginContainer>
      </Container>
      <Footer />
    </div>
  );
};

export default Login;
